import React from "react";

import OrderItem from "../order-item/order-item.component";

import "./order.styles.scss";

const Order = ({ dataItem }) => {
const { id, date, items, name, location, city, country, zip, price } = dataItem;
// console.lof(dataItem, 'agdgsddg')
    return (
        <div className="order">
        <h2 className="order-title">ORDER # {id}</h2>
        <h2>{date}</h2>
        <div className="order-area">
          <div>
          {
              items.map(item => <OrderItem cartItems={item} key={id} />)
          }
          </div>
          <div className="item-details">
          <div>{name}</div>
            <div className='address'>
                <span>{location}</span>
                <span>{city}</span>
                <span>{country}</span>
                <span>{zip}</span>
            </div>
            <span>{price}</span>
          </div>
        </div>
      </div>
    );
}

export default Order;
